/**
 * App.js 
 * - The main app component
 * - A container of all major components
 */


 // Load react from `node_modules`
import React from "react";
import './App.css';

// App Component
// const App = () => {
function App () {

  // Example usage of JavaScript within JSX
  const message = "Assalamu Alaykum Ya Ahlal Imaan!";

  // The contents of this return statement, 
  // get rendered as HTML and populated in the index.html root element
  return (

    // This is NOT HTML, it is JSX (JavaScript XML)
    <div>
      <h1>Hello React World!</h1>
      <h2 onClick={() => alert('You clicked the message!')} >{message}</h2>
    </div>
  );
};

export default App;
